import { getPokemonBase} from "../../Store/action";
import React, { useState } from 'react';
import axios from 'axios';
import { useEffect } from "react";
import { useDispatch} from "react-redux";
import './addPokemon.css';

export default function AddPokemon() {
  
    const dispatch=useDispatch();
  const [name, setName] = useState('');
  const [nameError, setNameError] = useState('');
  const [life, setVida] = useState(0);
  const [vidaError, setVidaError] = useState('');
  const [error, setError] = useState('');
  const [hp, setFuerza] = useState(0);
  const [defense, setDefensa] = useState(0);
  const [speed, setVelocidad] = useState(0);
  const [height, setAltura] = useState(0);
  const [weight, setPeso] = useState(0);
  const [type, setTipo] = useState('');
  const [url, setUrl] = useState('');
  const [status, setStatus] = useState('');
  useEffect(() => {  
      dispatch(getPokemonBase(2))
    },[ ]);
  
 

  const handleSubmit = (event) => {
    event.preventDefault();
   
    if(!name){
      setNameError('El nombre es requerido');
    }
    if(isNaN(life)||isNaN(hp)||isNaN(defense)||isNaN(speed)||isNaN(height)||isNaN(weight)) {
      setVidaError('La vida debe ser un número');
    }if(life.lenght>0||hp.lenght>0||defense.lenght>0||speed.lenght>0||height.lenght>0||weight.lenght>0){
      setError('debe ser mayor de 0')
    }
    else{
  
      axios.post('http://localhost:3001/pokemons/', {
        name,
        life,
        hp,
        defense,
        speed,
        height,
        weight,
        type,
        url
      })
      .then(response => setStatus(response.status))
      .catch(error => console.error(error));
    }
    if(status===200) setStatus('pokemon creado')
  }

  return (
  <>
  
      <div className='box-central'>
        <h2 className='titulo'>Crear Pokemon</h2>
      <form className=' form' onSubmit={handleSubmit}>
       
       <label className='input'>
         Name:
         <input type="text" onChange={e => setName(e.target.value)} />
         {nameError && <h5 >{nameError}</h5>}
       </label>
       <br />
       <label className=''>
       Life:
         <input type="number"  onChange={e => setVida(e.target.value)} />
         {vidaError && <h5 >{vidaError}</h5>}
         {error&&<h5>{error}</h5>}
       </label>
       <br />
       <label className=''>
         Hp:
         <input type="number"  onChange={e => setFuerza(e.target.value)} />
         {vidaError && <h5 >{vidaError}</h5>}
         {error&&<h5>{error}</h5>}
       </label>
       <br />
       <label className=''>
       Defense:
         <input type=""  onChange={e => setDefensa(e.target.value)} />
         {vidaError && <h5 >{vidaError}</h5>}
         {error&&<h5>{error}</h5>}
       </label>
       <br />
       <label className=''>
       Speed:
         <input type="number"  onChange={e => setVelocidad(e.target.value)} />
         {vidaError && <h5 >{vidaError}</h5>}
         {error&&<h5>{error}</h5>}
       </label>
       <br />
       <label className=''>
       Height:
         <input type="number" onChange={e => setAltura(e.target.value)} />
         {vidaError && <h5 >{vidaError}</h5>}
         {error&&<h5>{error}</h5>}
       </label>
       <br />
       <label className=''>
       Weight:
         <input type="number" onChange={e => setPeso(e.target.value)} />
         {vidaError && <h5 >{vidaError}</h5>}
         {error&&<h5>{error}</h5>}
       </label >
       <br />
       <label className='' >
       Type:
         <input type="text" onChange={e => setTipo(e.target.value)} />
         {status===200 && <h5>creado el pokemon</h5>}

       </label>
       <label className='' >
       <br />
       Url:
         <input type="text" value={'https://media3.giphy.com/media/DRfu7BT8ZK1uo/giphy.gif?cid=ecf05e47gnw179bell2grclua6wv313jklkjigupmkui19nl&rid=giphy.gif&ct=g'} onChange={e => setUrl(e.target.value)} />
         
         
       </label>
       <br />
       <button className='' type="submit">Submit</button>
       {status===200 && alert('pokemon creado!!')}
     </form>
        
      </div>

    
    </>
  )
}
